    false,nt"url": null,nt"notes": "This report describes an Atlantic white
    cedar swamp restoration project. This project will study the restoration of the
    once prevalent ecosystem. Three ecosystem services selected for comparative evaluation
    are biodiversity, water quality and discharge, and carbon cycling. The experimental
    design will contrast mature and immature, naturally regenerated Atlantic white cedar
    stands or restoration attempts in Great Dismal Swamp Wildlife Refuge, Alligator
    River National Wildlife Refuge, and Pocosin Lakes National Wildlife Refuge.",nt"owner_org":
